CREATE DATABASE IF NOT EXISTS myDB;
USE myDB;

DROP TABLE IF EXISTS images;

CREATE TABLE IF NOT EXISTS images (
    `key` int NOT NULL PRIMARY KEY,
    image varchar(10000)
);

